var title_f29_41_30354="BMD and fracture risk by age";
var content_f29_41_30354=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F72007&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F72007&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 626px\">",
"   <div class=\"ttl\">",
"    BMD and fracture risk by age",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 606px; height: 631px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Bone loss begins in the third decade of life in both sexes. The data are from the Epidemiological Follow-up Study cohort of the First National Health and Nutrition Examination Survey (NHANES), a nationally representative sample of noninstitutionalized civilians who were followed for a maximum of 22 years. A cohort of 2879 Caucasian men (1437 in the bone density subsample) aged 45 to 74 years at baseline (1971-1975) were observed through 1992 [From: Looker AC, et al. Osteoporosis Int 1998; 8:468].",
"    <br>",
"     (B) Age is a more critical determinant of fracture risk than bone mass in humans. Data are from a follow-up of 521 Caucasian women over an average of 6.5 yr with repeated bone mass measurements at the radius. A total of 138 nonspinal fractures in 3388 person-years were detected, and the incident fractures were cross-classified by age and bone mass. The incidence of fracture was then fitted to a log-linear model in age and bone mass [From: Hui SL, et al. J Clin Invest 1988; 81:1804].",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"      Reproduced with permission from: Manolagas SC. From estrogen-centric to aging and oxidative stress: A revised perspective of the pathogenesis of osteoporosis. Endocr Rev 2010; 31:266. Copyright &copy; 2010 The Endocrine Society.",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
