var content_f29_41_30365=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F60734&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F60734&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Dietary recommendations for toddlers to early-school-age children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Food groups and number of daily servings",
"       </td>",
"       <td class=\"subtitle1\">",
"        Age 12 to 23 months",
"       </td>",
"       <td class=\"subtitle1\">",
"        Age 2 to 3 years",
"       </td>",
"       <td class=\"subtitle1\">",
"        Age 4 to 8 years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Milk and milk products*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Low-fat or fat-free milk or milk products",
"        </em>",
"       </td>",
"       <td>",
"        2 cups/day (whole milk or milk products)",
"       </td>",
"       <td>",
"        2 to 2.5 cups/day",
"       </td>",
"       <td>",
"        2.5 to 3 cups/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"4\">",
"        <p>",
"         1 cup equivalent =",
"        </p>",
"        <p>",
"         1 cup of milk or yogurt, 1&frac12; ounces of natural cheese, 2 ounces of processed cheese, 1/3 cup of shredded cheese",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Meat and other protein foods",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Includes beef, chicken, pork, poultry, fish, eggs, peanut butter, and legumes",
"        </em>",
"       </td>",
"       <td>",
"        1&frac12; ounces/day",
"       </td>",
"       <td>",
"        2 ounces/day",
"       </td>",
"       <td>",
"        3 to 4 ounces/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"4\">",
"        <p>",
"         1 ounce equivalent =",
"        </p>",
"        <p>",
"         1 ounce of beef, poultry, or fish, &frac14; cup cooked beans, 1 egg, 1 tablespoon peanut butter",
"         <sup>",
"          &bull;",
"         </sup>",
"         , &frac12; ounce of nuts",
"         <sup>",
"          &bull;",
"         </sup>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Breads, cereals and starches",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Includes whole-grain breads, infant and cooked cereals, rice, pasta, ready-to-eat cereals. Half of all starches should be whole grains.",
"        </em>",
"       </td>",
"       <td>",
"        2 ounces/day",
"       </td>",
"       <td>",
"        3 ounces/day",
"       </td>",
"       <td>",
"        4 to 5 ounces/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"4\">",
"        <p>",
"         1 ounce equivalent =",
"        </p>",
"        <p>",
"         1 slice whole-grain bread, &frac12; cup cooked cereal, rice or pasta, 1 cup dry cereal",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Fruits",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Includes one source of vitamin C daily (citrus fruits and juices, strawberries) and one source of vitamin A every other day (dark green and yellow fruits, melons)",
"        </em>",
"       </td>",
"       <td>",
"        1 cup/day",
"       </td>",
"       <td>",
"        1 cup/day",
"       </td>",
"       <td>",
"        1 to 1&frac12; cups/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"4\">",
"        <p>",
"         1 cup equivalent =",
"        </p>",
"        <p>",
"         1 cup of fruit or 100 percent fruit juice",
"         <sup>",
"          &Delta;",
"         </sup>",
"         , &frac12; cup of dried fruit",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Vegetables",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Includes one source of vitamin C daily (broccoli and tomatoes) and one source of vitamin A every other day (spinach, sweet potatoes, corn, squash)",
"        </em>",
"       </td>",
"       <td>",
"        &frac34; cup/day",
"       </td>",
"       <td>",
"        1 cup/day",
"       </td>",
"       <td>",
"        1&frac12; cups/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"4\">",
"        <p>",
"         1 cup equivalent =",
"        </p>",
"        <p>",
"         1 cup of raw or cooked vegetables or vegetable juice, 2 cups of raw leafy greens",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Fats and oils",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Includes margarine, butter, oils",
"        </em>",
"       </td>",
"       <td>",
"        Do not limit*",
"       </td>",
"       <td>",
"        3 teaspoons/day",
"       </td>",
"       <td>",
"        4 teaspoons/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"4\">",
"        <p>",
"         1 teaspoon equivalent =",
"        </p>",
"        <p>",
"         1 teaspoon oil, margarine, butter or mayonnaise, 1 tablespoon salad dressing, sour cream or light mayonnaise",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Miscellaneous",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Desserts, sweets, soft drinks, candy, jams and jelly",
"        </em>",
"       </td>",
"       <td colspan=\"4\">",
"        Limit to small amount, use sparingly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Limit intake",
"       </td>",
"       <td>",
"        165 to 170 discretionary calories",
"       </td>",
"       <td>",
"        170 to 195 discretionary calories",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    NOTE: For more details, go to",
"    <a href=\"file://www.myplate.gov\" target=\"_blank\">",
"     www.myplate.gov",
"    </a>",
"    .",
"    <div class=\"footnotes\">",
"     * Low fat products are not recommended for children under the age of 2.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      May be a choking hazard for children under the age of 3.",
"      <br>",
"       &Delta; Children should be encouraged to consume whole fruits. Recommended to limit fruit juice to 4 to 6 ounces for children 1 to 6 years of age. Recommended to limit fruit juice to 8 to 12 ounces for children 7 to 18 years of age.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted with permission from: Texas Children's Hospital Pediatric Nutrition Reference Guide 2010, 9th Ed. Bunting KD, Mills J, Phillips S, et al (eds). Copyright &copy; 2010 Texas Children's Hospital. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
